import { Link } from "react-router-dom";
import Flight from "../../assets/images/flight.png";
import Train from "../../assets/images/train.png";
import Bus from "../../assets/images/bus.png";
import Cab from "../../assets/images/car.png";
import { useState } from "react";

const WebNav = () => {
    const [isLoggedIn, setIsLoggedIn] = useState(true); // Set initial login state
    const [expandNav, setExpandNav] = useState(false); // Set initial state for menu expansion
    const [selectedOption, setSelectedOption] = useState(""); // State to manage dropdown selection

    const handleOptionChange = (event) => {
        setSelectedOption(event.target.value);
    };

    const handleSignOut = () => {
        // Perform sign out actions here, such as clearing session, etc.
        setIsLoggedIn(false);
    };

    // Toggle menu function
    const handleMenu = () => {
        setExpandNav(!expandNav);
    };

    // Render sign in/sign out link based on login state
    const renderAuthLink = () => {
        if (isLoggedIn) {
            return (
                <div className="flex items-center relative">
                <div className="cursor-pointer" onClick={() => handleMenu()}>
                    <span className="mr-2">Account</span>
                    <svg xmlns="http://www.w3.org/2000/svg" width="16" height="16" fill="currentColor" className={`bi bi-caret-${expandNav ? 'up' : 'down'}`} viewBox="0 0 16 16">
                        <path fillRule="evenodd" d="M8 10.172l-5.5-5.5a1 1 0 0 1 1.414-1.414L8 7.344l4.793-4.793a1 1 0 1 1 1.414 1.414l-5.5 5.5a1 1 0 0 1-1.414 0z"/>
                    </svg>
                </div>
                {expandNav && (
                    <div  className="absolute top-full right-0 padding bg-white p-4 border rounded shadow-md" >
                        <ul>
                            <li><Link to="/profile">Profile</Link></li>
                            <li><Link to="/my-bookings">My Bookings</Link></li>
                            <li><Link to="/cancel-tickets">Cancel Tickets</Link></li>
                            <li><Link to="/show-my-ticket">Show My Ticket</Link></li>
                            <li><button onClick={handleSignOut}>Sign Out</button></li>
                        </ul>
                    </div>
                )}
            </div>
            );
        } else {
            return (
                <div className="flex-item">
                    <Link to="/sign-in" className="border-1-custom py-2 px-4 rounded-md transition-all duration-300 hover:bg-gray-300">Sign In or Register</Link>
                </div>
            );
        }
    };

    return (
        <div className='webnav_area w-full py-4'>
            <div className="max-w-6xl w-full px-4 lg:px-0 mx-auto">
                <div className="flex items-center justify-between flex-wrap font-bold">
                    <div className="flex-item">
                        <Link to="/">
                            <h2 className='text-3xl font-extrabold inline'>fATA-fAT Yatra</h2>
                        </Link>
                    </div>
                    <div className="flex-item hidden lg:block">
                        <Link to="/busses" className='mr-3 border-1-custom py-2 px-4 rounded-full transition-all duration-300 hover:bg-gray-300'>
                            <img src={Bus} className="w-5 inline mr-1" alt="bus" />
                            <span>Buses</span>
                        </Link>
                    </div>
                    {renderAuthLink()}
                    <div className="flex-item lg:hidden">
                        <div onClick={() => handleMenu()}>
                            <svg xmlns="http://www.w3.org/2000/svg" width="30" height="30" fill="currentColor" className="bi bi-list" viewBox="0 0 16 16">
                                <path fillRule="evenodd" d="M2.5 12a.5.5 0 0 1 .5-.5h10a.5.5 0 0 1 0 1H3a.5.5 0 0 1-.5-.5zm0-4a.5.5 0 0 1 .5-.5h10a.5.5 0 0 1 0 1H3a.5.5 0 0 1-.5-.5zm0-4a.5.5 0 0 1 .5-.5h10a.5.5 0 0 1 0 1H3a.5.5 0 0 1-.5-.5z" />
                            </svg>
                        </div>
                        {(expandNav === true) &&
                            <div className="h-screen w-2/3 bg-white absolute top-0 left-0 z-50 drop-shadow px-2 transition-all duration-300">
                                <div className="text-right pt-10" onClick={() => handleMenu()}>Close Menu</div>
                                <ul className="pt-20">
                                    <li className="bg-gray-200 px-3 text-lg rounded-md py-3 mb-1 text-indigo-600"><Link to="/flighs">Travel with Flight</Link></li>
                                    <li className="bg-gray-200 px-3 text-lg rounded-md py-3 mb-1 text-indigo-600"><Link to="/trains">Travel with Train</Link></li>
                                    <li className="bg-gray-200 px-3 text-lg rounded-md py-3 mb-1 text-indigo-600"><Link to="/">Travel with Bus</Link></li>
                                    <li className="bg-gray-200 px-3 text-lg rounded-md py-3 mb-1 text-indigo-600"><Link to="/">Travel with Cab</Link></li>
                                    <li className="bg-gray-200 px-3 text-lg rounded-md py-3 mb-1 text-indigo-600"><Link to="/sign-in">Sign In or Register</Link></li>
                                </ul>
                            </div>}
                    </div>
                </div>
            </div>
        </div>
    );
};

export default WebNav;
